import React from "react";

const App = ()=>{
  return(
    <React.Fragment>
      <nav>
        <ul>
          <li>Home</li>
          <li>Product</li>
          <li>Services</li>
          <li>Contact Us</li>
        </ul>
      </nav>
    </React.Fragment>
  );
}

export default App;
